import React from 'react'

const Search = ({search,setSearch}) => {
  return (
    <form onSubmit={(e)=>e.preventD}>
        <label>Search:</label>
        <input
        type='text'
        id='search'
        placeholder='Search Items'
        value = {search}
        onChange={(e)=>setSearch(e.target.value)}
        />
    </form>
  )
}

export default Search
